select min(total_cost) as min_total_cost
from (
    select c.hospitalid, sum(c.cost) as total_cost
    from cost c
    join treatment t on c.eventid = t.treatmentid and c.eventtype = 'treatment'
    join patient p on c.patienthealthsystemstayid = p.patienthealthsystemstayid
    where t.treatmentname = 'bronchodilator - leukotriene receptor antagonists'
    group by c.hospitalid
) subquery;

select min(c.total_cost) as min_total_cost
from (
    select sum(cost.cost) as total_cost, p.patientunitstayid
    from cost
    join medication m on cost.eventtype = 'medication' and cost.eventid = m.medicationid
    join patient p on cost.patienthealthsystemstayid = p.patienthealthsystemstayid
    where m.drugname like 'electrolytes - intravenous'
      and strftime('%Y', cost.chargetime) = '2104'
    group by p.patientunitstayid
) c;

select avg(total_cost) as average_total_hospital_cost
from (
    select c.patienthealthsystemstayid, sum(c.cost) as total_cost
    from cost c
    join microlab m on c.eventid = m.microlabid
    where c.eventtype = 'lab'
      and m.culturesite = 'surgical specimen'
      and c.chargetime >= date('2105-12-31', '-3 years')
    group by c.patienthealthsystemstayid
) subquery;

